import React from 'react'
import { Link } from 'react-router-dom';

const VideoCard = ({info,size}) => {
    const {snippet,statistics}=info;
    const {channelTitle,title,thumbnails}=snippet

    let tstyle="";
    if(size){
      tstyle=size;
    }else{
      tstyle=" h-60";
    }

    console.log(tstyle);

  return (
    <Link to={"/watch?v="+info.id}>
    <div className='overflow-hidden p-2 m-2 shadow-lg h-66 w-80'>
        <img alt="thumbnail" className={'rounded-lg'+tstyle} src={thumbnails?.high?.url}/>
        <ul>
          <li className='font-bold py-2'>{title}</li>
          <li>{channelTitle}</li>
          <li>{statistics.viewCount}</li>
        </ul>
    </div>
    </Link>
  )
}

export default VideoCard
